import React from 'react';
import ProblemPage from '../ProblemPage/ProblemPage';
import HintAccordion from '../Hints/HintAccordion';
import HintIcon from '../Hints/HintIcon';
import HintContent from '../Hints/HintContent';

const Problem1 = ({ handleProblemCompletion, isSolved, savedAnswer, themeColors }) => {
  const [visibleHint, setVisibleHint] = React.useState(null);

  return (
    <ProblemPage
      problemNumber={1}
      title="-family"
      correctAnswer="hitch"
      handleProblemCompletion={handleProblemCompletion}
      isSolved={isSolved}
      savedAnswer={savedAnswer}
      themeColors={themeColors}
      hint={
        <div className="space-y-4">
          <br />
          <p>Here are some hints to help you solve this puzzle:</p>
          <div className="space-y-2">
            <HintAccordion 
              title={
                <div className="flex items-center">
                  <HintIcon isOpen={visibleHint === 0} />
                  <span className="ml-2">Hint 1</span>
                </div>
              } 
              borderColor={themeColors.active}
              isOpen={visibleHint === 0}
              onToggle={() => setVisibleHint(visibleHint === 0 ? null : 0)}
            >
              <HintContent isVisible={visibleHint === 0}>
                <span style={{ fontFamily: 'Helvetica' }}>nyc subway signage</span>
                <br />
                <span style={{ fontFamily: 'Impact' }}>memes</span>
                <br />
                <span style={{ fontFamily: 'Times New Roman' }}>scientific journals</span>
                <br />
                <span style={{ fontFamily: 'Courier' }}>film script</span>
                <br />
                <span style={{ fontFamily: 'Highway Gothic' }}>stop sign</span>
              </HintContent>
            </HintAccordion>

            <HintAccordion 
              title={
                <div className="flex items-center">
                  <HintIcon isOpen={visibleHint === 1} />
                  <span className="ml-2">Hint 2</span>
                </div>
              }
              borderColor={themeColors.active}
              isOpen={visibleHint === 1}
              onToggle={() => setVisibleHint(visibleHint === 1 ? null : 1)}
            >
              <HintContent isVisible={visibleHint === 1}>
                Each item uses an iconic font.
              </HintContent>
            </HintAccordion>

            <HintAccordion 
              title={
                <div className="flex items-center">
                  <HintIcon isOpen={visibleHint === 2} />
                  <span className="ml-2">Hint 3</span>
                </div>
              }
              borderColor={themeColors.active}
              isOpen={visibleHint === 2}
              onToggle={() => setVisibleHint(visibleHint === 2 ? null : 2)}
            >
              <HintContent isVisible={visibleHint === 2}>
                Use the first letter of each font name to get the answer.
              </HintContent>
            </HintAccordion>

            <HintAccordion 
              title={
                <div className="flex items-center">
                  <HintIcon isOpen={visibleHint === 3} />
                  <span className="ml-2">⭐ Solution</span>
                </div>
              }
              borderColor={themeColors.active}
              isOpen={visibleHint === 3}
              onToggle={() => setVisibleHint(visibleHint === 3 ? null : 3)}
            >
              <HintContent isVisible={visibleHint === 3}>
                After finding the font name that is used for each item, use the first letter of each font name to get the answer.
                <br />

                <br />

                nyc subway signage → helvetica
                <br />
                memes → impact
                <br />
                scientific journals → times new roman
                <br />
                film script → courier
                <br />
                stop sign → highway gothic
                <br />
                <br />
                <span className="relative">
                  Answer: <span className="font-bold text-gray-600 hover:text-black bg-gray-600 hover:bg-transparent transition-all ease-in-out duration-150 px-1">HITCH</span>
                </span>
              </HintContent>
            </HintAccordion>
          </div>
        </div>
      }
    >
      <div>
        <p>nyc subway signage</p>
        <p>meme</p>
        <p>scientific journal</p>
        <p>film script</p>
        <p>stop sign</p>
      </div>
    </ProblemPage>
  );
};

export default Problem1;
